import {useState, useEffect} from "react";
import axios from "axios";

const Customer = ()=> {
    const [data, setData] = useState(null);
    const allCustomer = () => {
        axios.get('http://localhost:8090/test/api/customer/all').then(res=> {
          console.log(res.data);
        });
    }
    useEffect(()=>{
        allCustomer();
    },[]);
    return (
        <>
        <ul>
            <li></li>
        </ul>
        </>
    )
}
export default Customer;
